import React from "react";
import logo from "./logo.svg";
import "./App.css";
import FullName from "./FullName";

function App() {
  return (
    <div className="App">
      <div id="name-wrapper">
        <div id="tape-holder">
          <FullName />
        </div>
        <div>
          Icons made by{" "}
          <a href="https://www.flaticon.com/authors/freepik" title="Freepik">
            Freepik
          </a>{" "}
          from <a href="https://www.flaticon.com/" title="Flaticon"></a>
        </div>
      </div>
    </div>
  );
}

export default App;
